export const getEntries = () =>   async (dispatch) => {
        try{
            const response = await fetch("http://localhost:8080/api/entery/");
            const data = await response.json()
            console.log(data)
        }
        catch(e){
            console.log(e)
        }
        dispatch({type: "LOAD_ITEMS", payload: data})

}
